import React from 'react';
import logo from './logo.svg';
import './App.css';

function MyButton() {
    const goToHomePage = () => {
        window.location.href('.'); /* name of the page */
    };
  return (
      <button onClick={goToHomePage} className= "button-class" />
  );
}

function App() {
  return (
    <div className="App">
        <header className="App-header">
            <img src={logo} className="App-logo" alt="logo"/>
            <p>This is a learning page</p>
            <a className="App-header"
               href="https://reactjs.org"
               target="_blank"
               rel="noopener noreferrer"
            >
                Learn React
            </a>
        </header>
        <MyButton/>
    </div>
  );
}

export default App;
